import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";

export default function Register() {
  const [formValues, setFormValues] = useState({});
  const [formError, setFormError] = useState({});
  const navigate = useNavigate();

  const onChangeHandler = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });

    if (name === "cpassword") {
      setFormError({
        ...formError,
        password: value !== formValues.password ? "*Passwords do not match" : "",
      });
    } else if (name === "password" && formValues.cpassword) {
      setFormError({
        ...formError,
        password: formValues.cpassword !== value ? "*Passwords do not match" : "",
      });
    }
  };

  const submit = async (e) => {
    e.preventDefault();
    if (Object.keys(formError).length > 0) {
      alert("Please fix the errors before submitting.");
      return;
    }

    try {
      const response = await axios.post(`${apiUrl}/user/`, formValues);
      if (response.status === 200) {
        alert("Registration successful!");
        navigate("/login");
      }
    } catch (error) {
      console.error("Registration error:", error);
      alert("Registration failed. Please try again.");
    }
  };

  return (
    <div
      style={{
        height: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center", // Center the form vertically
        backgroundColor: "lightgray",
      }}
    >
      <div
        className="container mt-5"
        style={{
          maxWidth: "100vh", // Limit the width for better design
          boxShadow: "2px 3px 8px black",
          backgroundColor: "lightblue",
          padding: "20px",
          borderRadius: "10px",
          marginTop: "20px",
          textAlign: "center", // Center the text inside the form
        }}
      >
        <h3
          className="text-dark"
          style={{
            textAlign: "t", // Center the title
            marginBottom: "20px", // Add space below the title
          }}
        >
          Registration
        </h3>
        <form onSubmit={submit} method="post" style={{ maxWidth: "100%", margin: "0 auto", padding: "20px", border: "1px solid #ccc" }}>
          {/* First Name */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="first_name" style={{ display: "block", marginBottom: "5px" }}>First Name</label>
            <input
              required
              type="text"
              name="first_name"
              id="first_name"
              placeholder="First Name"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
          </div>

          {/* Last Name */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="last_name" style={{ display: "block", marginBottom: "5px" }}>Last Name</label>
            <input
              type="text"
              name="last_name"
              id="last_name"
              placeholder="Last Name"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
          </div>

          {/* Username */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="username" style={{ display: "block", marginBottom: "5px" }}>Username</label>
            <input
              required
              type="text"
              name="username"
              id="username"
              placeholder="Username"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
          </div>

          {/* Mobile Number */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="mobile" style={{ display: "block", marginBottom: "5px" }}>Mobile Number</label>
            <input
              required
              type="text"
              name="mobile_no"
              id="mobile"
              placeholder="Mobile Number"
              pattern="[6789][0-9]{9}"
              title="Please enter a valid phone number"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
          </div>

          {/* Email */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="email" style={{ display: "block", marginBottom: "5px" }}>Email</label>
            <input
              required
              type="email"
              name="email"
              id="email"
              placeholder="Email"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
          </div>

          {/* Password */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="password" style={{ display: "block", marginBottom: "5px" }}>Password</label>
            <input
              required
              type="password"
              className="form-control"
              name="password"
              id="password"
              placeholder="Password"
              pattern="(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{8,}"
              title="Must contain at least one number and one uppercase and lowercase letter, and at least 8 or more characters"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
          </div>

          {/* Confirm Password */}
          <div className="mb-3" style={{ textAlign: "center" }}>
            <label htmlFor="cpassword" style={{ display: "block", marginBottom: "5px" }}>Confirm Password</label>
            <input
              required
              type="password"
              name="cpassword"
              placeholder="Confirm Password"
              className="form-control"
              id="cpassword"
              onChange={onChangeHandler}
              style={{ width: "100%", padding: "10px", border: "1px solid #ccc" }}
            />
            <p className="text-danger" style={{ marginTop: "5px" }}>{formError.password}</p>
          </div>

          {/* Submit Button */}
          <div className="text-center">
            <button
              type="submit"
              className="btn btn-dark"
              style={{
                marginTop: "10px",
                padding: "10px 20px",
                backgroundColor: "#007bff",
                color: "#fff",
                border: "none",
                cursor: "pointer",
              }}
            >
              Register
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}
